import React, { useState, useEffect } from "react";
// import "./Styles.css";

function Contact() {
  useEffect(() => {
    fetching();
  }, []);
  const [datas, setData] = useState({
    basemap: {},
  });

  const fetching = () => {
    var url = new URL(
      "https://maps.geoapify.com/v1/styles/osm-carto/style.json?apiKey=c9d537a678bb427e998a64fddaebf3aa"
    );

    fetch(url)
      .then((response) => response.json())
      .then((data) => {
        console.log(data.sprite);
        setData(data.sprite);
      })
      .catch((err) => console.log(err));
  };

  return (
    <div className="centered">
      <h2>Contact and Map</h2>
      <iframe className="mapContent" src={datas}></iframe>
    </div>
  );
}

export default Contact;
